import React from 'react';
import ReactDOM from 'react-dom/client';
import './globals.css';
import App from './App.tsx';

// Create root and render the app
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
